import React from "react";
import Navbar from "../../Components/Navbar/Navbar";
import "./Orders.css";

function Orders() {
  
    const OrderBox = () => {
        return(  
        <>
        {OrderBox.map}  
        </>
        )
    }
  return (
    <div>
      <Navbar />
      <div className="head">
        <h2>Your Orders</h2>
        <input className="box" type="text" placeholder="Search" />
        <button>Search</button>
      <OrderBox/>
      </div>
      <div>

      </div>
    </div>
  );
}

export default Orders;
